import React from 'react';
import styled from 'styled-components';
import QuizModalFrame from './QuizModalFrame';

const Col = styled.div`
  display: flex;
  width: 100%;
  background: lavender;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
`;

const Row = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  justify-content: flex-start;
  align-items: center;
`;

const Header = styled.div`
  font-family: 'Roboto', sans-serif;
  font-style: normal;
  font-weight: bold;
  font-size: 1.725rem;
  line-height: 50px;
`;

const SubHeader = styled.div`
  font-family: 'Roboto', sans-serif;
  font-style: normal;
  font-weight: bold;
  margin-top: 1.25rem;
  margin-bottom: 10px;
  font-size: 1rem;
`;

const Questions = styled.div`
  font-family: 'Roboto', sans-serif;
  font-style: normal;
  font-weight: normal;
  font-size: 1rem;
`;

const SummaryModal = ({ _handleModal }) => {
  return (
    <QuizModalFrame _handleModal={_handleModal}>
      <Col>
        <Header>OX Quiz</Header>
        <Row style={{ justifyContent: 'space-between' }}>
          <SubHeader>QUESTIONS</SubHeader>
          <SubHeader style={{ marginRight: '3rem' }}>TRUE/FALSE</SubHeader>
        </Row>
        <Row>
          <Header>01</Header>
        </Row>
      </Col>
    </QuizModalFrame>
  );
};

export default SummaryModal;
